import React from 'react';
import money from './money.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <img src={money} className="App-logo" alt="img" />
      <h1>Exchange Rate Calculator</h1>
      <p>Choose the currency and the amounts to get the exchange rate</p>
    </div>
  );
}

export default App;
